import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';



function App() {
  return (
    <Router>
      <div>
        <Header />

        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />
        <Route path="/topics" component={Topics} />
      </div>

    </Router>
  );
}

export default App;
